INSERT INTO `pages` (`id`, `name_page`, `url_page`, `content`, `created_at`, `updated_at`, `active_page`) VALUES
(1, 'Актуално за сезона!', 'Update for the season!', '<h2 style=\"font-style:italic\">Коренища и грудки за уникалността на вашата градина...</h2>\r\n\r\n<h2 style=\"font-style:italic\"><a href=\"http://www.floromaniq.com/store/search?sub_category=Ruminants,_tubers,_bulbs\">http://www.floromaniq.com/store/search?sub_category=Ruminants,_tubers,_bulbs</a></h2>\r\n\r\n<p><img alt=\"\" src=\"http://www.theplantexplorer.com/Resources/Files/Helleborus/Helleborus%20fra%20Het%20Wil/Helleborus%20or.%20double%20mixed%20farver.jpg\" style=\"height:355px; width:500px\" /><img alt=\"\" src=\"http://cdn.lekuvai.bg/lekuvai/2018/01/zdravec-kichest-geranium-himalayense-plenum-52414372-0.jpg\" style=\"height:579px; width:579px\" /><img alt=\"\" src=\"https://parfium.bg/img/objects/articles_full_280_705674879-1567719101.jpg\" style=\"height:357px; width:670px\" /></p>\r\n\r\n<p><img alt=\"\" src=\"http://dantricdn.com/Uploaded/2009/06/15/tn_thucvat156910.jpg\" style=\"height:282px; width:377px\" /></p>\r\n\r\n<p><img alt=\"\" src=\"https://www.syl.ru/misc/i/ai/206704/935148.jpg\" style=\"height:465px; width:700px\" /></p>', '2017-12-09 15:41:16', '2018-03-14 10:35:15', 1),
(2, 'И нека пролетта влезе във вашата стая...', 'And let spring come into your room...', '<h2 style=\"font-style:italic\">...и се превърне в градина!</h2>\r\n\r\n<p><a href=\"http://www.floromaniq.com/store/search?category=9\">http://www.floromaniq.com/store/search?category=9</a></p>\r\n\r\n<p><img alt=\"\" src=\"http://www.strelitzia-bg.com/images/products/5474_1.jpg\" style=\"height:400px; width:400px\" /></p>\r\n\r\n<p><img alt=\"\" src=\"http://www.micasarevista.com/var/decoracion/storage/images/mi-casa/terraza-jardines-porche/12-plantas-de-sol-para-el-verano/alegria-guineana/1119295-1-esl-ES/alegria-guineana_galeria_landscape.jpg\" style=\"height:451px; width:600px\" /></p>\r\n\r\n<p><img alt=\"\" src=\"http://www.floromaniq.com/storage/upload_pictures/227/basic_1521028013.jpg\" style=\"height:1000px; width:1000px\" /></p>\r\n\r\n<p>&nbsp;</p>', '2017-12-12 10:38:39', '2018-03-14 10:49:55', 1),
(4, 'Доставка', 'Delivery', '<p>Уважаеми клиенти,</p>\r\n\r\n<p>След като потвърдите поръчката си, доставката ще бъде извършена в повечето случаи в следващият работен ден, вкл.събота.</p>\r\n\r\n<p>И не по-късно от два работни дни.</p>\r\n\r\n<p><strong>Доставката</strong> се плаща допълнително и е за <strong>сметка на получателя</strong>.</p>\r\n\r\n<p>Стойността на поръчката се заплаща на куриера.</p>\r\n\r\n<p>Пратките се доставят до <strong>офис на ЕКОНТ</strong> и стойността е&nbsp;около 4 - 5 лв. за пратки около 1 - 2 кг. или до <strong>посочен от Вас адрес</strong> - 7 - 8 лв.&nbsp;за пратки около 1 - 2 кг.</p>\r\n\r\n<p>Цената на доставка се определя в зависимост от теглото, височината, стойността и дестинацията. Тя се заплаща допълнително и е за <strong>сметка на получателя</strong>.</p>\r\n\r\n<p><a href=\"http://www.econt.com/tariff-calculator/\">http://www.econt.com/tariff-calculator/</a></p>\r\n\r\n<p><img alt=\"\" src=\"http://prognoziram.info/wp-content/uploads/2016/06/econt.jpg\" style=\"height:139px; width:180px\" /></p>', '2017-12-20 07:55:43', '2018-01-13 07:32:19', 1),
(5, 'Подари ваучер', 'Give a voucher', '<p><a href=\"http://www.floromaniq.com/store/search?category=18\">http://www.floromaniq.com/store/search?category=18</a></p>\r\n\r\n<p><img alt=\"\" src=\"http://inews.bg/pictures/1659039_375_282_4x3.png\" style=\"height:281px; width:375px\" /></p>', '2018-01-18 10:00:59', '2018-01-18 11:17:15', 1);
