(181, 14, 27, 'Fertilizers for flowers', 0, 0, 0, 1, '{\"article_id\":null,\"title_product\":\"Торни пръчици\",\"product_status\":\"Наличен\",\"delivery_price\":\"2.60\",\"price\":\"4.90\",\"old_price\":null,\"currency\":\"лв.\",\"short_description\":\"Многокомпонентен дълготрайно действащ тор с високо качество във вид на пръчици. Предназначени за торене на всякакви саксийни и балконски растения. Съдържащите се в тях хранителни елементи се набавят от растението равномерно и дълготрайно.\",\"general_description\":\"<p>Съдържа:&nbsp;<br \\/>\\r\\naзот (N) - 12%<br \\/>\\r\\nфосфор (P2O5) - 6%<br \\/>\\r\\nкалий (K2O) - 8%<br \\/>\\r\\nмагнезий (MgO) - 4%<\\/p>\\r\\n\\r\\n<p>Хранителни микроелементи:<br \\/>\\r\\nБор (B) 0,02%, Мед (Cu)* 0,02%, Желязо (Fe)* 0,07%, Манган (Mn)* 0,04%, Молибден (Mo) 0,004%, Цинк (Zn)* 0,015%<br \\/>\\r\\n&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;<\\/p>\",\"upload_main_picture\":\"basic_1519132026.jpg\",\"gallery\":[{\"upload_picture\":\"gallery_0_1519132030.jpg\"}]}', '2018-02-20 12:07:14', '2018-02-20 12:11:16'),
(182, 14, 27, 'Fertilizers', 0, 0, 0, 1, '{\"article_id\":null,\"title_product\":\"Торни пръчици\",\"product_status\":\"Наличен\",\"delivery_price\":\"3.30\",\"price\":\"5.90\",\"old_price\":null,\"currency\":\"лв.\",\"short_description\":\"Многокомпонентен дълготрайно действащ тор с високо качество във вид на пръчици. Те са продуктивни, полезни и удобни за употреба. Съдържащите се в тях хранителни елементи се набавят от растението равномерно и дълготрайно.\",\"general_description\":\"<p>Съдържа:&nbsp;<br \\/>\\r\\naзот (N) - 12%<br \\/>\\r\\nфосфор (P2O5) - 6%<br \\/>\\r\\nкалий (K2O) - 8%<br \\/>\\r\\nмагнезий (MgO) - 4%<\\/p>\\r\\n\\r\\n<p>Хранителни микроелементи:<br \\/>\\r\\nБор (B) 0,02%, Мед (Cu)* 0,02%, Желязо (Fe)* 0,07%, Манган (Mn)* 0,04%, Молибден (Mo) 0,004%, Цинк (Zn)* 0,015%<br \\/>\\r\\n&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;<\\/p>\",\"upload_main_picture\":\"basic_1519132529.jpg\",\"gallery\":[{\"upload_picture\":\"gallery_0_1519132533.jpg\"}]}', '2018-02-20 12:15:38', '2018-02-20 12:15:38'),
(183, 14, 27, 'Fertilizers', 0, 0, 0, 1, '{\"article_id\":null,\"title_product\":\"Тор градински универсален 1 кг\",\"product_status\":\"Наличен\",\"delivery_price\":\"4.90\",\"price\":\"9.90\",\"old_price\":null,\"currency\":\"лв.\",\"short_description\":\"100% разтворим във вода \\/ За 1000 литра тор за поливане\\r\\n\\r\\nМного продуктивен, лесно разтворим многокомпонентен тор в кристална форма. Предназначен за торене на всякакви растения, отглеждани в градините, на терасата и балкона, а също и в помещения. Осигурява прравилен растеж и развитие на торените растения.\",\"general_description\":\"<p>Съдържа: азот (N) - 21%, фосфор (P2O5) - 10%, калий (K2O) - 18%, магнезий (MgO) - 2%<\\/p>\\r\\n\\r\\n<p>Хранителни микроелементи:<br \\/>\\r\\nБор (B) 0,02%, Мед (Cu)* 0,02%, Желязо (Fe)* 0,07%, Манган (Mn)* 0,04%, Молибден (Mo) 0,004%, Цинк (Zn)* 0,015%&nbsp;<br \\/>\\r\\n* ЕДТА комплекс<\\/p>\",\"upload_main_picture\":\"basic_1519132797.jpg\"}', '2018-02-20 12:19:58', '2018-02-20 12:19:58'),
